import { Home, Final_Project, Check } from "../pages";

const routes = [
    {
        path: '/',
        component: {Home},
    },
    {
        path: '/final_project',
        component: {Final_Project},
    },
    {
        path: '/uploads',
        component: {Check},
    },
];

export default routes;
